import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // The profile page is dynamically generated by a JavaScript function.
    // We will call this function directly to ensure the profile content is loaded.
    await page.evaluate(() => {
      // This function is defined in the script.js file and renders the profile view.
      if (typeof showProfile === 'function') {
        showProfile();
      }
    });

    // Wait for the profile page container to be visible
    await page.waitForSelector('.profile-page', { timeout: 5000 });

    // Take a screenshot of the profile page
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile_page.png'));

    // Extract user profile information
    const fullName = await page.locator('.profile-info h2').textContent();
    const username = await page.locator('.profile-info .username').textContent();
    const bio = await page.locator('.profile-info .bio').textContent();

    // Extract profile stats
    const orders = await page.locator('.stat:has-text("Orders") .stat-number').textContent();
    const reviews = await page.locator('.stat:has-text("Reviews") .stat-number').textContent();
    const sellerRating = await page.locator('.stat:has-text("Seller Rating") .stat-number').textContent();

    const extractedData = {
      fullName: fullName.trim(),
      username: username.trim(),
      bio: bio.trim(),
      totalOrders: parseInt(orders.trim(), 10),
      totalReviews: parseInt(reviews.trim(), 10),
      sellerRating: parseFloat(sellerRating.trim())
    };

    return {
      success: true,
      action: "Successfully harvested user profile information.",
      extractedData: extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to harvest user profile information",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
